import React from 'react';
import './Node.css';

const Node = ({ isStart, isEnd, searched, isPath, row, col, targetDiv }) => {
    const classes = isStart ? "node_start" : isEnd ? "node_end" : isPath ? "node_path" : "";
    const dragAble = isStart ? true : isEnd ? true : false;

    return (
        <div className={`node ${classes}`} id={`node-${row}-${col}`} draggable={dragAble}>

        </div>
    )
}

export default Node;
